import React from 'react';

import SignIn from './SignInSignUp';
import './sing-in-sign-up.scss';

const SignInSignUp = () => {
  return (
    <div className='sing-in-sign-up'>
      <SignIn />
    </div>
  );
};

export default SignInSignUp;
